import React, { Component } from 'react';
import {Link} from "react-router-dom";
import { Nav, Navbar } from 'react-bootstrap'

class HomePage extends Component {
    constructor() {
      super();
      this.state = {
        username: "",
        password: "",
        data: []
    };
    }


    render() {
      return (
        <div>
        <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="/Home">Bmi Calculator</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="/BmiDetail">Bmi records</Nav.Link>
      <Nav.Link href="/BmiPage">Add Bmi Record</Nav.Link>
      <Nav.Link href="/register">Add New User</Nav.Link>
      <Nav.Link href="/ChartPage">Chart</Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
<img src="bmipg3.jpg" width = "100%" className="center" alt=""></img>
<h1>Bmi Calculator</h1>
</div>
    );
    
      }
    }
    
    
  export default HomePage;
